import React, { useState, useContext } from "react";
import { TransactionContext } from "../contexts/TransactionContext";

const defaultCategories = ["Food", "Travel", "Utilities", "Entertainment", "Miscellaneous"];

const AddTransaction = () => {
  const { addTransaction, transactions } = useContext(TransactionContext);
  const [type, setType] = useState("expense");
  const [description, setDescription] = useState("");
  const [amount, setAmount] = useState("");
  const [category, setCategory] = useState("");
  const [date, setDate] = useState("");
  const [customCategories, setCustomCategories] = useState([]);

  const handleAddCategory = (e) => {
    e.preventDefault();
    if (category && !customCategories.includes(category)) {
      setCustomCategories([...customCategories, category]);
    }
    setCategory("");
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const newTransaction = {
      type,
      description,
      amount: parseFloat(amount),
      category: category || "Miscellaneous",
      date,
    };
    addTransaction(newTransaction);
    setType("expense");
    setDescription("");
    setAmount("");
    setCategory("");
    setDate("");
  };

  const calculateSummary = () => {
    let totalIncome = 0;
    let totalExpense = 0;

    transactions.forEach((transaction) => {
      if (transaction.type === "income") {
        totalIncome += transaction.amount;
      } else {
        totalExpense += transaction.amount;
      }
    });

    return {
      totalIncome,
      totalExpense,
      balance: totalIncome - totalExpense,
    };
  };

  const summary = calculateSummary();

  return (
    <div>
      <form onSubmit={handleSubmit}>
        <label>
          Type:
          <select value={type} onChange={(e) => setType(e.target.value)}>
            <option value="expense">Expense</option>
            <option value="income">Income</option>
          </select>
        </label>
        <br />
        <label>
          Description:
          <input
            type="text"
            value={description}
            onChange={(e) => setDescription(e.target.value)}
            required
          />
        </label>
        <br />
        <label>
          Amount:
          <input
            type="number"
            value={amount}
            onChange={(e) => setAmount(e.target.value)}
            required
          />
        </label>
        <br />
        <label>
          Category:
          <select
            value={category}
            onChange={(e) => setCategory(e.target.value)}
          >
            <option value="">Select Category</option>
            {defaultCategories.map((cat, index) => (
              <option key={index} value={cat}>
                {cat}
              </option>
            ))}
            {customCategories.map((cat, index) => (
              <option key={`custom-${index}`} value={cat}>
                {cat}
              </option>
            ))}
          </select>
        </label>
        <button type="button" onClick={handleAddCategory}>
          Add Custom Category
        </button>
        <br />
        <label>
          Date:
          <input
            type="date"
            value={date}
            onChange={(e) => setDate(e.target.value)}
            required
          />
        </label>
        <br />
        <button type="submit">Add Transaction</button>
      </form>

      <div>
        <h3>Summary</h3>
        <p>Total Income: ${summary.totalIncome.toFixed(2)}</p>
        <p>Total Expenses: ${summary.totalExpense.toFixed(2)}</p>
        <p>Balance: ${summary.balance.toFixed(2)}</p>
      </div>
    </div>
  );
};

export default AddTransaction;
